    handleClick(){

        const a = document.getElementsById(this.id).addEventListener("click", ()=>{
            this.setState((state,props)=>{
                return {clicked: this.id};
            })

        });

    }

    constructor(props){
        super(props)
        this.state = {
            clicked:"doktorzy"
        }
    }


    render(){
        if (this.state.clicked==="doktorzy"){
        return(
            <>
                <DoctorComponent/>
            </>
        );}
        if (this.state.clicked==="logowanie"){
            return(
                <>
                    <LoginComponent/>
                </>
            )
        }
    }
}

